const VideoItem = ({video: {snippet}}) => (
  <li>
    <img src={props.video.snippet.thumbnails.medium.url} 
      alt="video thumbnail"
    />
    <div>
  <p>{snippet.title}</p>
  <p>{props.video.snippet.channelTitle}</p>
  </div>
  </li>
);
export default VideoItem;
